import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './App.css';
import Header from './component/header/header';
import Footer from './component/footer/footer';
import User from './component/main/user';
import Home from './component/main/home';
import Sign_in from './component/main/sign_in';
import Movie from "./component/main/movie/movie";
import Movie_comming from "./component/main/movie/movie_comingsoon";
import Slot from "./component/main/movie/slot";
import Blogmain from "./component/main/blog/blog_main";

class App extends Component {
  render() {
    return (
        <Router>
          <div className="App">
              <Header/>
              {/*<User />*/}

              <Route exact path="/" component={Home} />
              <Route path="/user" component={User} />
              <Route path="/sign_in" component={Sign_in} />
              <Route path="/movie_nowshowing" component={Movie} />
              <Route path="/movie_commingsoon" component={Movie_comming} />
              <Route path="/slot" component={Slot} />
              <Route path="/blog" component={Blogmain} />
              <Route path="/contact" component={Slot} />
              <Route path="/payment" component={Slot} />

              <Footer/>

     </div>
  </Router>
    );
  }
}

export default App;
